    ["1200011"]=setmetatable({id=1200011,name="异兽碎骨",typeId=10002,quality=1,description="形似传说凶兽的牙齿，经过初步加工的乔木碎屑。可用于斯露德突破自我及武装的改造。",descriptionCopywriting="你瞧，那树干上长出来的，是不是很像那只带来灾祸的凶兽留下的痕迹？如果不假思索地吞咽下去，是不是会被诅咒凭依？建议还是不要轻易尝试比较好。",bagOrder=1011,iconNameB="item_1200011_l",iconName="item_1200011_m",smallIconName="item_1200011_s",limitTime=0,useParam=xlsNilTable,partId=0,decomposeId=0,decomposeNum=0,costCoin=0,saleReward=9999},mt),
